function AboutMe() {
    return (
        <section id="about">
            <h2>About Me</h2>
            <p>I'm a software development student at the Northern Alberta Institute of Tech.</p>
            <p>Aspiring to work as a developer</p>
        </section>
    );
}

export default AboutMe;
